<script>
  
var top_btn = document.getElementById('top_btn');	

//when user start scrolling this function start working
window.onscroll = function(){scrollfunction()};
function scrollfunction(){
  if(document.body.scrollTop>200 || document.documentElement.scrollTop >200){
    top_btn.style.display = "block";
  }
  else{
    top_btn.style.display = "none";

  }
}

function top_function() {
  window.scrollTo({
    top: 0,
    behavior: 'smooth'
  });
}

var all = document.querySelectorAll('body');

function showModal() {
  // Get the modal element
  var modal = document.getElementById('myModal');

  // Check if modal is not already displayed
  var computedStyle = window.getComputedStyle(modal);
  if (computedStyle.display === 'none') {
    // Show the modal
    modal.style.display = 'block';

    // Iterate through the NodeList and set opacity for each body element
    all.forEach(function (element) {
      element.style.opacity = '0.7';
    });

    
    modal.style.opacity = '1.7';
    // Set up timeouts to change modal width
    setTimeout(function () {
      modal.style.width = '80%';
    }, 1000);
    setTimeout(function () {
      modal.style.width = '70%';
    }, 2000);
    setTimeout(function () {
      modal.style.width = '60%';
    }, 3000);
    setTimeout(function () {
      modal.style.width = '50%';
    }, 4000);

    // Hide the modal after 5 seconds
    setTimeout(function () {
      modal.style.display = 'none';

      // Reset the opacity for body elements
      all.forEach(function (element) {
        element.style.opacity = '1';
      });
    }, 5000);
  }
}

// Call the showModal function after 5 seconds
setTimeout(showModal, 5000);

function close_btn() {
  var modal = document.getElementById('myModal');
  modal.style.display = 'none';
  
  // Reset the opacity for body elements
  all.forEach(function (element) {
    element.style.opacity = '1';
  });
}

</script>
</html>
